import _ from 'lodash';
import {
  GET_DATAS,
  GET_DATA,
  ADD_DATA,
  DELETE_DATA,
  EDIT_DATA
} from '../actions/types';

export default (state = {}, action) => {
  switch (action.type) {
    case GET_DATAS:
      return {
        ...state,
        ..._.mapKeys(action.payload, 'id')
      };
    case GET_DATA:
    case ADD_DATA:
    case EDIT_DATA:
      return {
        ...state,
        [action.payload.id]: action.payload
      };
    case DELETE_DATA:
      return _.omit(state, action.payload);
    default:
      return state;
  }
};
